import React from 'react'
import { useState, useEffect } from 'react'
import checkedIcon from "../../public/checked.svg"
import uncheckedIcon from "../icons/unchecked.svg"
function Check({completed}: {completed: boolean}) {
    const [checked, setChecked] = useState(false)
    

    const handleCheck = () => {
        setChecked(!checked)
    }



  return (
    <>
     {
            checked ? <img src={checkedIcon} alt="checked" onClick={handleCheck} /> : <img src={uncheckedIcon} alt="unchecked" onClick={handleCheck} />  
     }
    </>
  )
}

export default Check
